description:
City kid Ren MacCormack moves to a small town where rocknroll and dancing have been banned, and his rebellious spirit shakes up the populace.

Cast: Andie MacDowell, Dennis Quaid, Clay Chappell, Kim Dickens, Patricia French, Sandra Ellis Lafferty, Clayton Landey, Ray McKinnon, Brett Rice, John Still and others

